import React from 'react';
import QuestionText from './components/questionText';
import './output.css';

function App() {
  return (
    <div className="flex justify-center w-full">
      <h1 className="flex justify-center text-5xl font-bold red">
        What are we building?
      </h1>
      <QuestionText />
    </div>
  );
}

export default App;
